import React from "react";
import { Container, Typography } from "@mui/material";
import { motion } from "framer-motion";

const PreSkill = () => {
    const variants = {
        hidden: {
          opacity: 0.2,
          y: 15
        },
        visible: (i) => ({
          opacity: 1,
          y: 0,
          transition: {
            delay: i * 0.2,
            duration: 1,
            repeat: Infinity,
            repeatType: "reverse"
          }
        })
      };

    return (
        <>
            <Container>
            <motion.div
            initial="hidden"
            animate="visible"
            variants={variants}
            custom={i}
          >

          </motion.div>
            </Container>
        </>
);
};
export default PreSkill;
